import * as React from 'react';



export const Symbol = ({ symbol }) => (

     <td id='symbol' 
         className='text_bold symbol gradBG centerText 
         textShadowGrey white_text text_bold headRightBorderGrey'  > 

          { symbol }

     </td>
);
